import React, { useState, useEffect } from "react";
import NavBar from "../../components/NavBar";
import Header from "../../components/Header";
import Modal from "react-modal"; // You might still need Modal for adding items

// Set the app element for react-modal
Modal.setAppElement("#root");

function ManageMenu() {
  const [isSidebarOpen, setIsSidebarOpen] = useState(true);
  const [restaurants, setRestaurants] = useState([
    // Demo restaurant data
    { _id: "1", name: "Delicious Diner" },
    { _id: "2", name: "Spicy Kitchen" },
    { _id: "3", name: "Fresh Fusion" },
  ]);
  const [selectedRestaurantId, setSelectedRestaurantId] = useState("");
  const [menuCategories, setMenuCategories] = useState([
    { name: "Salad", image: "menu_1.png" },
    { name: "Rolls", image: "menu_2.png" },
    { name: "Deserts", image: "menu_3.png" },
    { name: "Sandwich", image: "menu_4.png" },
    { name: "Cake", image: "menu_5.png" },
    { name: "Pure Veg", image: "menu_6.png" },
    { name: "Pasta", image: "menu_7.png" },
    { name: "Noodles", image: "menu_8.png" },
  ]);

  const toggleSidebar = () => {
    setIsSidebarOpen(!isSidebarOpen);
  };

  const handleRestaurantChange = (e) => {
    setSelectedRestaurantId(e.target.value);
  };

  const handleCategoryClick = (categoryName) => {
    if (selectedRestaurantId) {
      console.log(
        `Selected Restaurant ID: ${selectedRestaurantId}, Category: ${categoryName}`
      );
      // Here you would typically open a modal or navigate to a section
      // to add menu items for the selected restaurant and category.
      alert(
        `Adding items for Restaurant ID: ${selectedRestaurantId}, Category: ${categoryName} (functionality to be implemented)`
      );
    } else {
      alert("Please select a restaurant first.");
    }
  };

  return (
    <div className="flex h-screen overflow-hidden">
      {/* Sidebar (Navbar) */}
      <NavBar
        className={`${
          isSidebarOpen ? "w-64" : "w-0"
        } transition-all duration-300 ease-in-out`}
      />

      {/* Main Content */}
      <div className="flex-1 flex flex-col overflow-hidden">
        {/* Header */}
        <Header onToggleSidebar={toggleSidebar} />

        {/* Page Content */}
        <main className="flex-1 bg-gray-100 p-4 overflow-y-auto">
          <div className="container mx-auto">
            <h1 className="text-2xl font-semibold mb-4">Manage Menu Items</h1>

            <div className="mb-4">
              <label
                htmlFor="restaurant"
                className="block text-gray-700 text-sm font-bold mb-2"
              >
                Select Restaurant:
              </label>
              <select
                id="restaurant"
                className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
                value={selectedRestaurantId}
                onChange={handleRestaurantChange}
              >
                <option value="">-- Select a Restaurant --</option>
                {restaurants.map((restaurant) => (
                  <option key={restaurant._id} value={restaurant._id}>
                    {restaurant.name}
                  </option>
                ))}
              </select>
            </div>

            {selectedRestaurantId && (
              <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-4 gap-4 mt-8">
                {menuCategories.map((category) => (
                  <div
                    key={category.name}
                    className="relative rounded-full overflow-hidden shadow-md cursor-pointer hover:shadow-lg transition-shadow duration-300"
                    onClick={() => handleCategoryClick(category.name)}
                  >
                    <img
                      src={`/images/${category.image}`} // Assuming your images are in the public/images folder
                      alt={category.name}
                      className="w-full h-full object-cover"
                      style={{ aspectRatio: "1 / 1" }} // Maintain a circle aspect ratio
                    />
                    <div className="absolute bottom-0 left-0 right-0 bg-gray-900 bg-opacity-60 text-white py-2 text-center">
                      <span className="text-sm font-semibold">
                        {category.name}
                      </span>
                    </div>
                  </div>
                ))}
              </div>
            )}

            {!selectedRestaurantId && (
              <p className="mt-4 text-gray-500">
                Please select a restaurant to manage its menu items.
              </p>
            )}
          </div>
        </main>
      </div>
    </div>
  );
}

export default ManageMenu;
